import React from 'react'
import Frame from '../img/candidates/img.png'

const candidates = [
    {id: 1, name: 'Konang Tygazayn'},
    {id: 2, name: 'Kadek Ninda'},
    {id: 3, name: 'Billy Fahd Qodama'}
];

const Candid = (props) => {
    return (
        <div>
            <img src={Frame}></img>
            <div className='title gap-x-5'>
                <h1>{props.id}</h1>
                <h2>{props.name}</h2>
                {/* <h2>{props.candidate.name}</h2> */}
            </div>
        </div>
    );
};

export default Candid;
